import React from 'react';

import './Tweet.css';




const Tweet = props => (
    <div className='tweet'>
        
        <img src={props.avatar}/>
        <strong>{props.fullname}</strong>
        <strong>{props.date}</strong>
        <p>{props.content}</p>
    </div>
);

export default Tweet;
